const antiLeftDB = {}; // Temporary storage (Use a database for persistence)

const antiLeft = async (m, gss) => {
  try {
    const cmd = m.body.toLowerCase().trim();

    if (cmd === "antileft on") {
      antiLeftDB[m.from] = true;
      return m.reply("*âœ… Anti-Left is now ACTIVE. No one can leave this group.*\n\n*Regards, Bruce Bera*");
    }

    if (cmd === "antileft off") {
      antiLeftDB[m.from] = false;
      return m.reply("*âŒ Anti-Left is now OFF. Members can leave freely.*\n\n*Regards, Bruce Bera*");
    }
  } catch (error) {
    console.error("Error in Anti-Left command:", error);
    m.reply("âš ï¸ An error occurred. Try again.");
  }
};

const checkLeft = async (event, gss) => {
  try {
    if (!antiLeftDB[event.id]) return; // Check if Anti-Left is enabled

    const participant = event.participants[0];

    await gss.groupParticipantsUpdate(event.id, [participant], "add");
    await gss.sendMessage(
      event.id,
      { text: `*ðŸš« You cannot leave this group!*` },
      { mentions: [participant] }
    );
  } catch (error) {
    console.error("Error in Anti-Left:", error);
  }
};

export { antiLeft, checkLeft };
